import React from 'react';
import Title from '../Title/TitleSection';
import './MapSection.scss'

const MapSection = () => {
  return (
    <>
      <section className='wrapper'>
          <Title text={'Map'}/>
               
      </section>
     
    </>
  );
}

export default MapSection;
